INSERT INTO `products` VALUES (11,'B001BKEWF2','Serendipity 3 $100.00 Gift Card','Gift card for the purchase of goods or services at Serendipity 3 in New York City only. Not valid for online purchases.',0,2,9,100,0,'2022-02-09 18:29:36','2022-02-09 18:29:36'),(12,'B001GXRQW0','Amazon.com Gift Cards','Amazon.com Gift Cards are the perfect way to give them exactly what they\'re hoping for--even if you don\'t know what it is. Amazon.com Gift Cards are redeemable for millions of items storewide. and never expire.',0,1,0,100,0,'2022-02-09 18:29:36','2022-02-09 18:29:36'),(13,'B001M5GKHE','$25 Lobster Gram Gift Certificate','Dollar amount Certificates allow your recipient to choose the perfect package. as well as the day and most convenient location for delivery. Lobster Gram\'s Dollar Amount Gift Certificates are perfect for any occasion or holiday. and they are also available for your company\'s corporate incentive or award programs! Gift Certificates may be redeemed on the Lobster Gram website or by calling 1-800-Live-Lob (1-800-548-3562). PLEASE NOTE: Paper Gift Certificates are sent out via 1st Class U.S. Mail. unless an air letter is selected at checkout.',0,9,6,100,0,'2022-02-09 18:29:36','2022-02-09 18:29:36'),(14,'B002BSHDJK','Wilton Reception Gift Card Holder. White','Attractively keeps the wedding gift cards together at the reception. Tulle used for accents sold separately.',0,30,30,100,0,'2022-02-09 18:29:36','2022-02-09 18:29:36'),(15,'B002H9RN0C','iTunes - Gift Card $15','iTunes Gift Cards are perfect for anyone who enjoys one-stop entertainment. Each card is redeemable for music. movies. TV shows. apps. games. books. and more on the iTunes Store. the App Store. the iBookstore. or the Mac App Store.&nbsp;',0,9,6,100,0,'2022-02-09 18:29:36','2022-02-09 18:29:36'),(16,'B002MS7BPA',' Starbucks Gift Card','Since 1971. Starbucks Coffee Company has been committed to ethically sourcing and roasting the highest quality arabica coffee in the world. Today. with stores